window.showErrors = function (jqXhr) {
  if (jqXhr.status === 401) {
    $(location).prop('pathname', 'login');
  } else if (jqXhr.status === 422) {
    var $errors = jqXhr.responseJSON.errors;
    var errorsHtml = '';

    if (typeof $errors == "undefined") {
      $errors = jqXhr.responseJSON;
    }

    errorsHtml = '<div class="alert fade m-t-5 show alert-danger"><ul class="mb-0">';
    $.each($errors, function (key, value) {
      errorsHtml += '<li>' + value[0] + '</li>';
    });
    errorsHtml += '</ul></di>';
    $('#form-errors').removeClass('d-none').html(errorsHtml);
    return false;
  } else {
    errorsHtml = '<div class="alert fade m-t-5 show alert-danger">' + ':    !' + '</div>';
    $('#form-errors').html(errorsHtml);
    return false;
  }
};

window.getMessage = function (data) {
  var alerts = {
    success: '    !',
    failed: '   !'
  };
  var html_msg = '';
  var msg_type = false;
  var msg = '';

  if (data.status) {
    if (data.message != undefined) msg = data.message;else msg = alerts.success;
    html_msg = '<div>' + msg + '</div>';
    msg_type = true;
  } else {
    if (data.message != undefined) msg = data.message;else msg = alerts.failed;
    html_msg = '<div class="text-danger number-fa">' + msg + '</div>';
  }

  return {
    status: msg_type,
    message: html_msg
  };
};

window.getErrors = function (jqXhr) {
  var alerts = {
    failed: '   !'
  };
  var html_msg = '';

  if (jqXhr.status === 401) {
    $(location).prop('pathname', 'login');
  } else if (jqXhr.status === 422) {
    var $errors = jqXhr.responseJSON.errors;

    if (typeof $errors == "undefined") {
      $errors = jqXhr.responseJSON;
    }

    html_msg = '<div class="text-danger number-fa"><ul>';
    $.each($errors, function (key, value) {
      html_msg += '<li>' + value[0] + '</li>';
    });
    html_msg += '</ul></div>';
  } else if (jqXhr.status === 404) {
    html_msg = '<div class="text-danger number-fa">    ! (404)</div>';
  } else if (jqXhr.status === 403) {
    html_msg = '<div class="text-danger number-fa">  ! (403)</div>';
  } else {
    html_msg = '<div class="text-danger number-fa">' + alerts.failed + '</div>';
  }

  return html_msg;
};

